import { useEffect, useState } from 'react'
import getBackdrop from '../../services/getBackdrop'


export function useBackdrop() {
  const [parameter, setParameter] = useState()

    useEffect(() => {
        getBackdrop()
            .then(elements => { 
                setParameter(elements)
            }) 
    }, []) 

    console.log(parameter)
    return parameter
}
